import React from 'react';

const GetStartedButton = (props) => {
    return (
        <div id="get-started-button"
            className="d-flex flex-wrap align-items-center">

            <a href="/" className="btn btn-lg btn-primary mt-3">
                {props.ButtonText}
            </a>

        </div>
    );
}

export default GetStartedButton;
